import {Routes, Route} from "react-router-dom"
import Dashboard from "./pages/Dashboard/Dashboard"
import "./App.css"


const App = () => {
    return (
        <div>
            <Routes>
                <Route to="/" element={<Dashboard />} />
            </Routes>
        </div>
    )
}

export default App
